html {
  box-sizing: border-box;
}

*,
*:before,
*:after {
  box-sizing: inherit;
}

a {
  color: inherit;
}

body {
  color: #848e91;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}

html {
  font-size: 16px;
  color: #848e91;
}

body {
  animation-duration: 0.001s;
}

@media (min-width: 0px) {
  body {
    animation-name: mq-mobile;
  }
}
@keyframes mq-mobile {
  from {
    clip: rect(1px, auto, auto, auto);
  }
  to {
    clip: rect(0px, auto, auto, auto);
  }
}
@media (min-width: 640px) {
  body {
    animation-name: mq-tablet;
  }
}
@keyframes mq-tablet {
  from {
    clip: rect(1px, auto, auto, auto);
  }
  to {
    clip: rect(0px, auto, auto, auto);
  }
}
@media (min-width: 1280px) {
  body {
    animation-name: mq-desktop;
  }
}
@keyframes mq-desktop {
  from {
    clip: rect(1px, auto, auto, auto);
  }
  to {
    clip: rect(0px, auto, auto, auto);
  }
}
html {
  font-family: "Titillium Web";
  font-size: 1rem;
  font-weight: 400;
}

.fa,
.fas,
.far,
.fal,
.fad,
.fab {
  -moz-osx-font-smoothing: grayscale;
  -webkit-font-smoothing: antialiased;
  display: inline-block;
  font-style: normal;
  font-variant: normal;
  text-rendering: auto;
  line-height: 1;
}

